import React, { Component } from 'react';
import logo from './logo.jpeg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          <img src={logo} alt="logo" />
        </header>
        <div className="main">
        </div>
      </div>
    );
  }
}

export default App;
